"use strict";var tabs=document.querySelectorAll(".tab"),allPanels=document.querySelectorAll(".schedule");function activateTab(e){tabs.forEach(function(e){e.classList.remove("active")}),e.classList.add("active")}function openCourse(e,t){allPanels.forEach(function(e){e.style.display="none"}),document.getElementById(t).style.display="block",activateTab(e)}